  false,\n\t\"url\": null,\n\t\"notes\": \"This data set contains biological resource
  data for seagrasses in the Aleutian Islands, Alaska. Vector polygons in this data
  set represent locations of seagrass concentration areas. Species-specific abundance,
  seasonality, status, life history, and source information are stored in relational
  data tables (described below) designed to be used in conjunction with this spatial
  data layer.This data set comprises a portion of the Environmental Sensitivity Index
  (ESI) data for Aleutians East Borough and Aleutians West Coastal Resource Service
  Area (CRSA). These data identify the marine and coastal environments and wildlife.
  The ESI data include information for three main components: shoreline habitats,
  sensitive biological resources, and human-use resources.\",\n\t\"owner_org\": \"e811f0b4-451f-4896-9e8f-fc6802837819\",\n\t\"extras\":
